const md5 = require('md5');
const VC = require('../src/creds/VerifiableCredential');
const UCA = require('../src/uca/UserCollectableAttribute');

const generateSampleGenericId = () => {
  /**
   *   {
    identifier: 'civ:Credential:GenericId',
    version: '1',
    depends: [
      'civ:Type:address',
      'civ:Type:documentType',
      'civ:Type:documentNumber',
      'civ:Type:image',
      'civ:Identity:name',
      'civ:Identity:givenName',
      'civ:Identity:dateOfBirth',
      'civ:Identity:dateOfIssue',
      'civ:Identity:dateOfExpiry',
    ],
  },
   * @type {{day: number, month: number, year: number}}
   */

  const address = {
    street: 'Alameda dos Anjos',
    unit: '',
    city: 'Belo Horizonte',
    zipCode: '94103345',
    state: 'Minas Gerais',
    county: 'Sao Bento',
    country: 'Brazil',
  };
  const addressUca = new UCA('civ:Type:address', address);

  const documentTypeUca = new UCA('civ:Type:documentType', 'Driving License');
  const documentNumberUca = new UCA('civ:Type:documentNumber', 6524565265);
  const imageContent = 'data:image/jpeg;base64,';
  const imageMd5 = md5(imageContent);
  const documentImageUca = new UCA('civ:Type:image', { image: imageContent, md5: imageMd5 });
  const nameUCA = new UCA('civ:Identity:name', { first: 'Savio', middle: 'Grossi', last: 'Estolani' });
  const givenNameUCA = new UCA('civ:Identity:givenName', 'Daniel');

  const dateOfBirth = {
    day: 30,
    month: 4,
    year: 1986,
  };
  const dateOfBirthUca = new UCA('civ:Identity:dateOfBirth', dateOfBirth);

  const dateOfIssue = {
    day: 22,
    month: 10,
    year: 2014,
  };
  const dateOfIssueUca = new UCA('civ:Identity:dateOfIssue', dateOfIssue);

  const dateOfExpiry = {
    day: 22,
    month: 10,
    year: 2019,
  };
  const dateOfExpiryUca = new UCA('civ:Identity:dateOfExpiry', dateOfExpiry);

  const genericId = new VC('civ:Credential:GenericId', 'Civic', null, [addressUca, documentTypeUca, documentImageUca, documentNumberUca, nameUCA, givenNameUCA, dateOfBirthUca, dateOfExpiryUca, dateOfIssueUca], 1);

  genericId.requestAnchor().then((updatedCredential) => {
    updatedCredential.updateAnchor().then((definitive) => {
      console.log(JSON.stringify(definitive, null, 2));
    });
  });
};

const generateSampleCivicBasic = () => {
  const email = {
    user: 'savio',
    domain: 'civic.com',
  };
  const emailUca = new UCA('civ:Type:email', email);

  const phone = {
    number: '31999998888',
    countryCode: '55',
  };
  const phoneUca = new UCA('civ:Type:phone', phone);

  const civicBasic = new VC('civ:Credential:CivicBasic', 'did:ethr:0x1ddcbae835c47c8d9159756c167994931a5f01e8', 4102365600000, [emailUca, phoneUca], 1);

  civicBasic.requestAnchor().then((updatedCredential) => {
    updatedCredential.updateAnchor().then((definitive) => {
      console.log(JSON.stringify(definitive, null, 2));
    });
  });
};

